import React, { useState, useRef } from "react";
import yogamat from '../images/yogamat.jpg'
import { QnA } from './QnA'
import { ThemeClasses } from './ThemeClasses'
import styled from 'styled-components';
import 'react-dates/initialize'
import 'react-dates/lib/css/_datepicker.css'

const Section = styled.section`

  display: flex; 
  justify-content:center; 
  background-image: linear-gradient(rgba(0, 0, 0, 0), rgba(0, 0, 0, 0.5)), url(${yogamat});
 align-items: center; 
  flex-direction: column;
  color: #5e5e5e; 
  font-family: 'Barlow', sans-serif;

  background-size: cover;
`

const Wrapper = styled.div`
overflow-x: visible; 
// background-color: rgba(256,256,256,0.8);
background: white;
border-radius: 16px;
justify-content: center; 
width: 80%;
padding: 26px;
margin: 20px;
box-shadow: 0 4px 8px 0 rgba(0, 0, 0, 0.2), 0 6px 20px 0 rgba(0, 0, 0, 0.19);
display: flex;
flex-direction: column; 
align-items: center;
@media(min-width: 900px){  
justify-content: left;
flex-direction: row;
flex-wrap: wrap;

`

const TextCard = styled.div`
overflow-x: visible; 
background-color: rgba(256,256,256,0.8);
border-radius: 6px;
width: 80%;
padding: 26px;
margin: 20px 0;
 box-shadow: 0 4px 8px 0 rgba(0, 0, 0, 0.2), 0 6px 20px 0 rgba(0, 0, 0, 0.19);
@media(min-width: 900px){  
  margin: 30px 24px; 
}
@media(min-width: 1024px){
}
`
export const Classes = () => {
  return (
    <main>
      <Section>
        <Wrapper>
          <TextCard>Var yogar du med mig?
          För tillfället håller jag regelbundna klasser i hathayoga på Studio
          Yogaheart i Joanneberg, Göteborg. Se schema och boka på:
          https://www.timecenter.se/yogaheart/?
          rid=37019&tjid=&tidval=&date=&today=2020-05-26&overview=false
          På förfrågan håller jag även klasser privat. Därutöver erbjuder jag
          företagsyoga, yogaklasser i samband med konferenser, kick-offs,
          möhippor/svensexor/babyshowers, kalas, barnkalas osv.
          Jag erbjuder även personlig konsultation, s.k PTs.
För mer information, frågor eller bokning kontakta mig. </TextCard>
        </Wrapper>
        <ThemeClasses />
      </Section>
    </main>
  )
}
